import React from "react";

function Note(props) {
  return (
    <div className="note">
      <h1 id="title">{props.title}</h1>
      <p id="content">{props.content}</p>
      <button onClick={() => {props.onDelete(props.id)}}>DELETE</button>
      <button onClick={() => {props.onEdit(props.id)}}>EDIT</button>
    </div>
  );
}

export default Note;
